import React from "react";

const ProductList = ({ products, columns }) => {
  return (
    <div id="product-list">
      <header>
        <strong>{`Product List (${products.length} items)`}</strong>
      </header>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Department</th>
            <th>Currency</th>
            <th>Price</th>
          </tr>
        </thead>
        <tbody>
          {
            /* Display products here in new table rows */
            products.map(function ({
              id,
              name,
              department,
              currency,
              price,
              columns,
            }) {
              return (
                <tr key={id}>
                  {columns.id && <td>{id}</td>}
                  <td>{name}</td>
                  <td>{department}</td>
                  <td>{currency}</td>
                  <td>{price}</td>
                </tr>
              );
            })
          }
        </tbody>
      </table>
    </div>
  );
};

export default ProductList;
